import React from 'react';
import './App.css';
import 'fontsource-roboto';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Hello world! - Caleb Ren
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
